    "supplemental-fingerprint-card-data-sfcd-for-nist-special-database-9-nist-special-database-",nt"isopen":
    true,nt"url": null,nt"notes": "The NIST database of supplemental fingerprint
    card data provides a larger sample of fingerprint patterns that have a low natural
    frequency of occurrence and transitional fingerprint classes in NIST Special Database
    9.The data in NIST Special Database 10 is one zip file which contains 552 non-mated
    fingerprint cards which consist of 5520 fingerprint images with corresponding metadata
    files per image. Each segmented image is 832 by 768 pixels and classified using
    the National Crime Information Center (NCIC) classes given by the FBI. The database
    provides a large sample of patterns for transitional fingerprint classes and classes
    with a low natural frequency of occurrence in NIST Special Database 9. The images
    are formatted in Portable Network Graphics (PNG).NIST Special Database 10 has the
    following features:u00b7 552 non-mated cards of supplemental data concentrating
    on arches, tented arches, low ridge count loops and whorlsu00b7 NCIC classifications
    given by the FBI",nt"license_title": "Other License Specified",nt"extras":
